import React, { Component } from 'react'
import {HashRouter, Switch, Route} from 'react-router-dom'
import coreSysRoutes from './coreSys'; // 核心系统路由文件
const routeList = [...coreSysRoutes]; // 路由集合
const toDoRoures = (routeArr: any) => {
    if (!routeArr.length) return [];
    return routeArr.map((items: any) => {
        return <Route path={items.path} key={items.path} component={(): any => import(items.components)}></Route>
    })
}
export default class Routes extends Component {
    render() {
        return <HashRouter>
            <Switch>
                {toDoRoures(routeList)}
            </Switch>
        </HashRouter>
    }
}
